import React from 'react';

class SearchBar extends React.Component {



	render() {
		return (
			<form class="ui form">
				<div class="field">
					<label>Enter Movie</label>
					<input type="text"/>
				</div>
			</form>
		);
	};
}

export default SearchBar;
